import React, {useEffect} from 'react';
import {useDispatch} from "react-redux";
import '../../normalize.scss'

import ComponenteRanking from '../../components/Ranking/index';
import Banner from '../../components/Header/Banner/index';
import imgBanner from '../../components/Header/Banner/destaques/Ranking/1280.png'
import View from "../view/view"


function Ranking () {
  const dispath = useDispatch()

  useEffect(() => {
      API.get(config.APIS.PLAYERSTARS, '/console/')
          .then(response => {
              console.log("ESSE E O RESPONSE", response.data)
              dispath(setConsoles(response.data))
          })
          .catch(error => {
              console.log("ERRO NO GET: ")
          })
          // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [])
  return (
    <View public={false}>
          <Banner imagemBanner={imgBanner} />
          <ComponenteRanking />
    </View>
  )
}

export default Ranking;
